(852, '3518718290', '3607000976303344', 'Sat Aug 03 00:05:10 +0800 2013', '【“汽车三包”政策出台 今年十一起实施】国家质检总局15日发布了《家用汽车产品修理、更换、退货责任规定》，家用汽车产品包修期限不低于3年或者行驶里程6万公里，以先到者为准；家用汽车产品三包有效期限不低于2年或者行驶里程5万公里，以先到者为准。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww2.sinaimg.cn/large/d1bb6152jw1e78rg8lzp2j2064049q2y.jpg', 0, 0, 0),
(853, '3518718290', '3606931287661134', 'Fri Aug 02 19:28:16 +0800 2013', '【在本届北美车展中，林肯发布了旗下首款紧凑型SUV——MKC概念车】该车的首发也标志着林肯将进军紧凑型豪华多功能车市场。此前，林肯曾表示，将于2014下半年，通过新建独立的经销商网络在中国推出林肯产品，而MKC量产后，无疑将被引入国内。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww4.sinaimg.cn/large/d1bb6152jw1e78jg4g3waj20cs0ha3zy.jpg', 0, 0, 0),
