(861, '3518718290', '3606418470891215', 'Thu Aug 01 09:30:29 +0800 2013', '【孕妇可以吃酸菜鱼吗？】孕妇吃鱼是没有问题的；但酸菜是一种腌制食物，腌制食物中含有大量的亚硝酸盐，是一种容易致癌的物质；偶尔吃下腌制食物是可以的，天天吃就对健康不利了。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww4.sinaimg.cn/large/d1bb6152jw1e76wjum2rwj20ax07bglu.jpg', 0, 0, 0),
