(892, '3518718290', '3604366399249068', 'Fri Jul 26 17:36:17 +0800 2013', '有人说，蝴蝶再美，终飞不过海。这个雨天，即使还爱，即使带一点恨，即使为短暂的逗留而颤抖，最后也还是一个人走。泪流过后，不敢抬起头...被遗忘的是时间，无法遗忘的是心境和最初的念想~——薛啸秋钢琴曲《遗忘》', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'null', 0, 0, 0),
(893, '3518718290', '3604303455242215', 'Fri Jul 26 13:26:10 +0800 2013', '“高悬瀑布，远叠山，动听雀吟，静听蝉。不知松竹，谁先绿，难辩水天，哪最蓝。忽风桃花岸，白云裹红团，牧笛惊花雨，花边溪柳泉...”——陈思思《梦入桃花源》', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'null', 0, 0, 0),
(894, '3518718290', '3604233733523435', 'Fri Jul 26 08:49:08 +0800 2013', '“唐拉雅秀天空中呼吸，感动着彼此的心，回荡的祈福在传递，天地间爱不再神秘，唐拉雅秀编织着，念青唐古拉的情，隐没了浮华的起因，纯净的美丽，纯净的回忆，纯净中找回着自己....”——萨顶顶《唐拉雅秀》', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'null', 0, 0, 0),
(895, '3518718290', '3604170071988366', 'Fri Jul 26 04:36:09 +0800 2013', '推荐一首英文歌曲（中文翻译）！Leona Lewis 《Better In Time》只希望你带上耳机，认真享受聆听的过程，全世界就是你的！在你的心里！~', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'null', 0, 0, 0),
(896, '3518718290', '3604103886108132', 'Fri Jul 26 00:13:09 +0800 2013', '【提问：小朋友是不是应该添加些益生菌？】回答：小孩刚生出来的时候肠道是没有益生菌的，所以婴幼儿的喂养很重要，尽量建议母乳喂养，母乳中就有益生菌，没有必要添加，但是对于酸奶，小朋友要到一岁以后才能喝。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww3.sinaimg.cn/large/d1bb6152jw1e6ziq3xwffj20ay065t8s.jpg', 0, 0, 0),
(897, '3518718290', '3604040770129235', 'Thu Jul 25 20:02:20 +0800 2013', '【白醋减肥法】白醋所含有的氨基酸不只能耗费掉体内的脂肪，还同时能协助促进糖和蛋白质等物质的代谢。依据调查所得，每天摄入15毫升到20毫升的白醋，一个月就能增加6斤脂肪。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww2.sinaimg.cn/large/d1bb6152jw1e6zbh51dcaj209e08vab9.jpg', 0, 0, 0),
(898, '3518718290', '3603976853266440', 'Thu Jul 25 15:48:22 +0800 2013', '【减肥瘦身小办法】坚持每周5天，每天1次，每次在45分钟内走5公里的路程，这样做可在6个月内减去10磅体重。若在45分钟内走6。5公里，则体重下降得更快。也许有人会说“没有工夫漫步”。其实，工夫是挤出来的。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww3.sinaimg.cn/large/d1bb6152jw1e6z44vuan2j209f0axtau.jpg', 0, 0, 0),
(899, '3518718290', '3603919533534535', 'Thu Jul 25 12:00:36 +0800 2013', '【心理测试】最近下雨不断，好不容易约出心仪已久的对象，进行两人的第一次约会，出门前却又下起大雨，这时的你会有什么反应？【A】立刻想出个雨天活动备案；【B】心情沮丧，提不起劲；【C】決定取消约会，改天再约；【D】为对方准备雨具和擦乾雨水的手帕。（解析如图）。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww4.sinaimg.cn/large/d1bb6152jw1e6yxjw82zjj20c60p0jve.jpg', 0, 0, 0),
(900, '3518718290', '3603912151841678', 'Thu Jul 25 11:31:17 +0800 2013', '【保鲜膜瘦身法】没错，就是厨房里常用的保鲜膜。详细做法是：将保鲜膜紧紧缠在腿上，然后开端走路或跑步，做家务都得！每天坚持约45分钟至一个小时，可以有效避免脂肪囤积，帮你雕塑出安康美丽的腿部曲线。普通来说，当你每次揭下湿淋淋的保鲜膜那一刻，根本上就会晤到一些成效了！', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww1.sinaimg.cn/large/d1bb6152jw1e6ywpdlm83j209v05qaah.jpg', 0, 0, 0),
(901, '3518718290', '3603873098913346', 'Thu Jul 25 08:56:06 +0800 2013', '【一切烦恼来自执着】我们执着什么，就会被什么所骗。我们执着谁，就会被谁所伤害。所以我们要学会放下，凡事看淡一些，不牵挂，不计较，是是非非无所谓。无论失去什么，都不要失去好心情。把握住自己的心，让心境清净，洁白，安静。——放下不等于放弃，执着不等于坚持。 ', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww2.sinaimg.cn/large/d1bb6152jw1e6ys7wfj48j20c70b4q39.jpg', 0, 0, 0),
(902, '3518718290', '3603845709972791', 'Thu Jul 25 07:07:15 +0800 2013', '【喂母乳可促进减肥】很多人都不晓得，其实給孩子喂养母乳，不只能使宝宝的养分更为充足，同时还能使妈妈们变得愈加纤瘦，由于你身体里的养分曾经经过母乳传送给宝宝了，所以在吃的方面也可以愈加担心，不要舍近求远地跑去健身房了，只需把你的宝宝喂养空虚了，你一样可以轻松减肥。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww2.sinaimg.cn/large/d1bb6152jw1e6yp2nn6ccj20cs05s3yh.jpg', 0, 0, 0),
(903, '3518718290', '3603827293292583', 'Thu Jul 25 05:54:05 +0800 2013', '【心理提醒】当你在犹豫的时候，这个世界就很大；当你勇敢踏出第一步的时候，这个世界就很小。等到有一天你变成了你喜欢的自己的时候，谁还会质疑你的选择不靠谱呢？你已经变成更好的你了，一定会遇到更好的人的。你是谁，就会遇到谁。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww4.sinaimg.cn/large/d1bb6152jw1e6ymyinn3dj20bo07rt9y.jpg', 0, 0, 0),
(904, '3518718290', '3603778475556862', 'Thu Jul 25 02:40:06 +0800 2013', '【对抗抑郁、失恋以及减肥最棒的方法】怎样走出抑郁？心理学家告诉我们对抗抑郁的最棒方法。如果你坚持，就会顺理成章变成一个身心都更健康的人。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww4.sinaimg.cn/large/d1bb6152jw1e6yhcof81kj20c8083abe.jpg', 0, 0, 0),
(905, '3518718290', '3603776202551617', 'Thu Jul 25 02:31:04 +0800 2013', '2011年11月22日，中国发行量最大的故事刊物《故事会》迎来第500期。《故事会》创刊于1963年，是上海文艺出版社编辑出版的一本通俗文学杂志，办刊时间长，是中国的老牌刊物之一。先后获得两届中国期刊最高奖—国家期刊奖。并被评为中国驰名商标。这殊荣在中国期刊界绝无仅有。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww1.sinaimg.cn/large/d1bb6152jw1e6yh39uhilj208k0c0abn.jpg', 0, 0, 0),
(906, '3518718290', '3603733210877054', 'Wed Jul 24 23:40:10 +0800 2013', '【你追求的爱情】饥饿辘辘是每个人都有过的经验，假如有一天在非正餐时间，你饿得爱不了，你会吃什么东西来填饱叫个不停的肚子？【A】饼干、糖果等零食；【B】三文治、汉堡；【C】牛排；【D】叫碗面来吃。（解析如图）。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww1.sinaimg.cn/large/d1bb6152jw1e6yc5ivxx7j20c60qgdkd.jpg', 0, 0, 0),
(907, '3518718290', '3603713362639403', 'Wed Jul 24 22:21:20 +0800 2013', '【苏格兰爱丁堡的爱丁堡地下室】爱丁堡地下室是英国鬼魂经常触摸的地方。谣传这个地下室以前是是个妓院后来又成为连环杀手的犯罪场所。参观此处时，要提前做好心理准备，因为据不少人说在地下室看到一个没有脸的鬼魂出没，十分恐怖！', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww1.sinaimg.cn/large/d1bb6152jw1e6y9vgjq50j20c908l75u.jpg', 0, 0, 0),
(908, '3518718290', '3603683374090087', 'Wed Jul 24 20:22:09 +0800 2013', '【双子座情侣不可碰触忌讳】扑克脸最伤人；当他们眉飞色舞地跟你分享他们的趣事时，当然希望另一半能热烈地回应他们，如果这时你用一张扑克脸对着他们，多让人寒心啊！一次两次，双子座还无所谓，但是次数多了，他们会觉得两人之间无法交流。同欢同喜，一起开心，是双双们最喜欢的相处模式。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww4.sinaimg.cn/large/d1bb6152jw1e6y6fh3h8yj209q0dwgmv.jpg', 0, 0, 0),
(909, '3518718290', '3603648682639739', 'Wed Jul 24 18:04:19 +0800 2013', '黄巾起义可以说是东汉末年最大一次规模的人民起义，它是导致汉王朝直接灭亡的导火索。然而起义规模远远大于陈胜吴广大泽乡起义的黄巾起义，为何在历史上却得不到公正的评价，罗贯中在《三国演义》里更是蔑称他们为黄巾贼!', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww4.sinaimg.cn/large/d1bb6152jw1e6y2g1cu44j20c907ojs4.jpg', 0, 0, 0),
(910, '3518718290', '3603637332936819', 'Wed Jul 24 17:19:15 +0800 2013', '【狮子怎远离职场负能量】一旦职场失意、不得志，看不到公司或个人发展前景，狮子座便会郁郁寡欢，觉得自己的才能根本就没有得以完美的施展。温馨提示：即使感到不公、委屈，也应尽量先使自己心平气和下来再跟上级说，否则只会让对方觉得你太过自我，上下级的从属关系完全不放在眼里。 ', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww2.sinaimg.cn/large/d1bb6152jw1e6y1544m25j20ci09dt97.jpg', 0, 0, 0),
(911, '3518718290', '3603589824325425', 'Wed Jul 24 14:10:27 +0800 2013', '【处女女芳心暗许的征兆】严于律己，内敛矜持的处女女，跟大多数女性一样，对于一般的男性都会存有一定的警戒心理，不会随意去男性朋友的家里玩。但若处女女卸下了高筑的心墙，单独去中意的男子家玩时，就表明处女女对对方比较放心(当然也是满心爱慕的)。这时，对方一定要保持足够的绅士风度。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww1.sinaimg.cn/large/d1bb6152jw1e6xvooq887j208c0ciglm.jpg', 0, 0, 0),
(912, '3518718290', '3603585210279156', 'Wed Jul 24 13:52:08 +0800 2013', '公元1811年11月26日，晚清重臣曾国藩出生。湘军的创立者和统帅者。清朝军事家、理学家、政治家、书法家，文学家，官至两江总督、直隶总督、武英殿大学士，封一等毅勇侯，谥文正。他的人生，他的智慧，他的思想，深深地影响了几代中国人，提起曾国藩，人们仍然津津乐道。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww3.sinaimg.cn/large/d1bb6152jw1e6xv5m31yyj209g0cedgn.jpg', 0, 0, 0),
(913, '3518718290', '3603540679699867', 'Wed Jul 24 10:55:11 +0800 2013', '【12星座他没砍死你体之处女篇】楼主吐槽：我的处女座男朋友不是不理我就是嫌我脏，我趁他出去倒垃圾时把他牙刷在马桶里涮了几下又放回杯子里，被他发现，他竟然要和我分手。楼下回复：他没砍死你说明他爱你。楼主回复：可是他逼着我带他去医院做全身体检，一直嘚嘚咕咕到几天后体检报告出来……  ', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww3.sinaimg.cn/large/d1bb6152jw1e6xq1hw7g7j20dw08v3zd.jpg', 0, 0, 0);
INSERT INTO `total_weibo` (`id`, `userid`, `weiboid`, `time`, `content`, `datasource`, `bool1`, `bool2`, `pictureSource`, `number1`, `number2`, `number3`) VALUES
(914, '3518718290', '3603520101906481', 'Wed Jul 24 09:33:24 +0800 2013', '参军为何叫入伍？它的由来与我国古代军队编制有关。据《周礼》载：我国古代军队里：五人为伍，五伍为两，五两为卒，五卒为旅，五旅为师，五师为军。历代军队编制虽然不断变化，但伍的叫法却一直流传至今。到了近代，虽然近代的班、排、连代替了古老的伍、两、卒，但人们仍习惯把参军叫入伍。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww2.sinaimg.cn/large/d1bb6152jw1e6xnofcpyej20cl08h756.jpg', 0, 0, 0),
(915, '3518718290', '3603491329162169', 'Wed Jul 24 07:39:05 +0800 2013', '【双鱼座女人的爱情底线】能容忍——自己不是大老婆；不能容忍——整日柴米油盐酱醋茶，浪漫丁点不再。双鱼女的眼里天大地大浪漫最大，爱情至上，双鱼女一旦栽入爱情故事里，那叫一个感天动地泣鬼神，可以一退再退，委屈求全。但是爱情如何保鲜，这全人类迟早面临的难题，对双鱼女的影响是最大的。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww1.sinaimg.cn/large/d1bb6152jw1e6xkdgmxcqj20b407ewez.jpg', 0, 0, 0),
(916, '3518718290', '3603395711906464', 'Wed Jul 24 01:19:07 +0800 2013', '轻轻的旋律，挑动着我心弦，那感觉如此美妙。很好听。《冬季恋歌》Richard Clayderman。http://t.cn/hNAUf', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww1.sinaimg.cn/large/d1bb6152jw1e6x9e47og1j207b07bdg5.jpg', 0, 0, 0),
(917, '3518718290', '3603389931963684', 'Wed Jul 24 00:56:11 +0800 2013', '我是地道的蓝莓控、蓝莓控！', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww3.sinaimg.cn/large/d1bb6152jw1e6x8q7ukn0j20cs2rqwq5.jpg', 0, 0, 0),
(918, '3518718290', '3603346251913216', 'Tue Jul 23 22:02:34 +0800 2013', '充满了神秘感，富有节奏感，也许正是此时的你正在寻找的。《 Secrets》OneRepublic。http://t.cn/h0BXq', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww4.sinaimg.cn/large/d1bb6152jw1e6x3pmupyij208g08kq3f.jpg', 0, 0, 0),
(919, '3518718290', '3603320528825760', 'Tue Jul 23 20:20:23 +0800 2013', '【香葱肉燥菇御饭团】1.取150g米，依照洗米程序清洗，放入电锅中煮(米：水=1：1.3);2.取一干净砂锅，放入绞肉炒香至颜色变白，再放入香菇丝与所有调味料拌炒，随后再加入水煮至滾，转中小火续煮約40分钟。', '<a href="http://app.weibo.com/t/feed/3auC5p" rel="nofollow">皮皮时光机</a>', 'False', 'False', 'http://ww3.sinaimg.cn/large/d1bb6152jw1e6x0ra4pdjj20ac0c4t9v.jpg', 0, 0, 0),
