(992, '2848862212', '3620832385233578', 'Tue Sep 10 04:06:14 +0800 2013', '舍得舍得有舍必有得，忘记该忘记的，放弃该放弃的，改变能改变的，接受不能改变的。', '<a href="http://app.weibo.com/t/feed/9ksdit" rel="nofollow">iPhone客户端</a>', 'False', 'False', 'http://ww3.sinaimg.cn/large/5de52038tw1drgx6vv7jug.gif', 0, 0, 0),
(993, '2848862212', '3617337083161155', 'Sat Aug 31 12:37:09 +0800 2013', '#手机笑话#我大一的时候，那时候还没有人手一部手机，所以老爸打电话只能打寝室电话找我，有天老爸打电话过来，一室友接了。室友：“喂，你好，请问找哪位？” 我爸：“你好你好，我找我的宝贝女儿。” 室友：“……，叔叔，这里全是宝贝女儿。”', '<a href="http://weibo.com/" rel="nofollow">新浪微博</a>', 'False', 'False', 'http://ww4.sinaimg.cn/large/7da15ffejw1dnm24kvb85j.jpg', 0, 0, 0),
(994, '2848862212', '3614702359624048', 'Sat Aug 24 06:07:46 +0800 2013', '近日，日本女星苍井空到成都旅游，中午到其朋友的麒麟日本料理店吃午饭，店外几百影迷苦等求合影，苍井空也在店内大秀书法。', '<a href="http://weibo.com/" rel="nofollow">新浪微博</a>', 'False', 'False', 'http://ww2.sinaimg.cn/large/a9ce3004gw1e7xbxy5z6wj20b40fg3zt.jpg', 2, 1, 0),
(995, '2848862212', '3614702325813014', 'Sat Aug 24 06:07:35 +0800 2013', '【金铭恋上电影新贵安玉刚 众名人网上送祝福】9月3日凌晨，网络上突然出现一条“恋爱”祝福微博，而被点名的女主是曾经的童星金铭，而男方则是曾成功在国内市场推广《失恋33天》、《饥饿游戏》等电影，北京影行天下文化传播有限公司联合创始人安玉刚。众多名人纷纷在网上送祝福。', '<a href="http://weibo.com/" rel="nofollow">新浪微博</a>', 'False', 'False', 'null', 0, 0, 0),
(996, '2848862212', '3612430619427209', 'Sat Aug 17 23:40:37 +0800 2013', '【HR为员工避税省钱的一些窍门】1、将工资发放尽量安排在允许税前扣除额从下；2、分期领取劳动报酬；3、企业提供住所；4、企业提供假期旅游津贴；5、购买保险公司的理财险；6、部分计入工资单，其余工资采取用发票报销的方式。', '<a href="http://weibo.com/" rel="nofollow">新浪微博</a>', 'False', 'False', 'null', 0, 0, 0),
(997, '2848862212', '3607466841002815', 'Sun Aug 04 06:56:20 +0800 2013', '微博转发', '<a href="http://weibo.com/" rel="nofollow">新浪微博</a>', 'False', 'False', 'null', 5, 5, 0),
(998, '2848862212', '3607466774310266', 'Sun Aug 04 06:56:05 +0800 2013', '分享图片 去阿生宿舍，谈论组里的作业时。发现他们宿舍“海酿”竟然去外出泡妞，于是我趁他不在宿舍。打开他的电脑桌面截屏，然后发到我的电脑用PS进行加工，再把这张图变成他的电脑桌面，还把一面镜子放在屏幕的破碎中心点。现在等他回来看他的冷笑话！ ,大烧饼脸儿的猫娘娘 ,亜紗yasha', '<a href="http://weibo.com/" rel="nofollow">新浪微博</a>', 'False', 'False', 'http://ww4.sinaimg.cn/large/7e6c71c8gw1dqcit5kvi3j.jpg', 0, 0, 0),
(999, '2848862212', '3607466753336918', 'Sun Aug 04 06:56:00 +0800 2013', '【无论您的收入是多少，记得分成五份进行规划投资】1.增加对身体的投资，让身体始终好用；2.增加对社交的投资，扩大你的人脉；3.增加对学习的投资，加强你的自信；4.增加对旅游的投资，扩大你的见闻；5.增加对未来的投资，增加你的收益。好好规划落实，你会发现你的人生逐步会有大量盈余。', '<a href="http://weibo.com/" rel="nofollow">新浪微博</a>', 'False', 'False', 'http://ww2.sinaimg.cn/large/a9ce3004gw1e7a8y0tk6oj20c806w3z4.jpg', 0, 0, 0),
(1000, '2848862212', '3607466745219670', 'Sun Aug 04 06:55:58 +0800 2013', '给力！分享给大家啦。', '<a href="http://app.weibo.com/t/feed/4JpANe" rel="nofollow">微博搜索</a>', 'False', 'False', 'null', 0, 0, 0);
